import React from "react";
import { Route, Routes } from "react-router-dom";
import User from "./User";


const App = () => {
  return (
   
      <div>
        <h1>qqqqqqqqqqqqqqqqq</h1>
        <Routes>
          <Route path="/" element={<User  name="sameer"/>}/>     
        </Routes>
      </div>
    
  );
};

export default App;
